import { BsChevronRight } from "react-icons/bs";

function CourseListIntro(props) {
    return (
        <div className="course_list_intro">
            <span>{props.title}</span>
            <BsChevronRight />
            <p>무료강의부터 가볍게 시작해 보세요.</p>
        </div>
    )
}

export default CourseListIntro
